    )
  }

  const Checkbox = () =>{
    return(
    <div>
    <input type="checkbox" checked={false}></input>
    </div>
    )
  }


const TodoForm = () => {
const [imput, setimput] = useState("");

 const handle = e =>{
    e.preventDefault();
 }
  return (
    <div>
      <form className="Todo-form" onSubmit={ handle}>
        <input
          className="Todo-imput"
          type="text"
          placeholder="add new task"
          name="text"
          value={imput}
        />
        <Boutton>submit</Boutton>
        <Checkbox/>
              </form>
      
    </div>
  );
  
};



export default TodoForm;
